import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";
import '../App.css'
import Eachngo from "./eachngo";
import { Route , Routes} from "react-router-dom";

export default function Ngo_list(props){
    const navigate = useNavigate();
    function getthengo(id){

        return (
            <Routes>
                <Route exact path={`/ngo-list/${id}`} element={<Eachngo id = {id} />} />
            </Routes>
        )
    }
    return(
        <div className="ngo-item" onClick={()=>getthengo(props.id)}>
            <img src={props.img} alt='No Image!!'/>
            <h1>{props.title}</h1>
            <h5>Aim:- {props.aim}</h5>
            <p>Click to get full profile of this ngo</p>
        </div>
    )
}
